// import { Text } from "../components/Text/index";
// import { Button } from "../components/Button/index";

import Table from "components/Table/Table";
import "./style.css";
import { useRef } from "react";
const premedicationData = [
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
  {
    Medication: "SODIUM CHLORIDE",
    Dose: 1000,
    Route: "Intravenous",
    Instructions: "Once 60 minutes prior to chemotherapy",
  },
];
const chemotherapyData = [
  {
    Medication: "Prednisone",
    Dose: 100,
    Route: "Oral",
    Instructions: "Daily x 5 days. 1st dose 60 minutes prio to chemotherapy",
  },
  {
    Medication: "Doxorubicin",
    Dose: 50,
    Route: "Intravenous",
    Instructions: "IV Push over 15 minutes",
  },
  {
    Medication: "Doxorubicin",
    Dose: 50,
    Route: "Intravenous",
    Instructions: "IV Push over 15 minutes",
  },
  {
    Medication: "Doxorubicin",
    Dose: 50,
    Route: "Intravenous",
    Instructions: "IV Push over 15 minutes",
  },
];

export default function RegimenDetails() {
  const premedicationRef = useRef(null);
  const chemotherapyRef = useRef(null);
  const [premedicationHeight, setPremedicationHeight] = useState(0);

  useEffect(() => {
    if (premedicationRef.current) {
      setPremedicationHeight(premedicationRef.current.offsetHeight);
    }
  }, []);

  return (
    <>
      <div className="cycles">
        <span className="heading">Cycles</span>
        <div className="row">
          <input type="radio" />
          <span>Every</span>
        </div>
        <div className="row">
          <input type="radio" />
          <span>Day</span>
        </div>
        <button>Check</button>
      </div>
      <div className="medications">
        <span className="heading">Mediactions</span>
        <div className="premediaction" ref={premedicationRef}>
          <div className="premediactionTable">
            <p>PreMediactions</p>
            <div className="prebuttons">
              <button className="edit">Edit</button>
              <button className="del">Delete</button>
            </div>
          </div>
          <Table data={premedicationData} />
        </div>
        <div className="chemotherapy" ref={chemotherapyRef}>
          <div className="chemotherapyTable">
            <p>ChemoTherapy</p>
            <div className="chemobuttons">
              <button className="edit">Edit</button>
              <button className="del">Delete</button>
              <button className="dose">Change Dose</button>
            </div>
          </div>
          <Table data={chemotherapyData} />
        </div>
      </div>
      <div className="notes">
        <span className="heading">Physician Notes</span>
        <input type="text" placeholder="Add your notes here..." />
      </div>
    </>
  );
}
